import React from 'react';
import Navigation from './Navigation';
import { Container } from '@material-ui/core';

function Contain(props) {
  return (
    <Container maxWidth='sm'>
      <Navigation />
      <div>{props.children}</div>
    </Container>
  );
}

export default Contain;
